import React from 'react'
import Truck from '../images/truck_transparent_logo.png'

export default function Landing() {
    return (
        <div>
            <div className="landingText authBox">
                <h1>Maraetai Blue Limited</h1>
                <h6>East Auckland water tank delivery service.</h6> <p>We deliver litres and litres of drinking water pumped direct from our tankers to your door every day of the week.  We also offer a full tank clean and inspection service. </p>
            </div>
            <img className="landingImage" src={Truck} />
        </div>
    )
}
